import React from 'react';

const peicecount = ({ videos }) => {
// console.log(videos);
const videosPieces = videos.map(video => video.PIECES);
// console.log(videosPieces);
const reducer = function (previousValue, currentValue)  {
  previousValue + currentValue;
  console.log(previousValue)
};

const numberOfPieces = ((videosPieces.length != []) ? videosPieces.reduce(reducer): null);

return (
  <p>Pieces: {numberOfPieces}</p>
  );
};

export default peicecount;
